import React from 'react';

import Building from './Building';

const Buildings = props => {
  //TODO receive array of Buildings and call each one (can be 7 or 8)
  props.buildings.map( (building, index ) => { return <Building index={index} title={building} /> }



  );
  return (
    <div>
      <Building index="0" title="Cottage" />
      <Building index="1" title="Well" />
      <Building index="2" title="Theatr" />

    </div>
  );
}

export default Buildings;
